import axios from 'axios';
import React, { useEffect, useState } from 'react';
import MeetingDataUploadComp from './meetingDataUploadComp';

function MeetingDataComp() {
    const [superUser, setSuperUser] = useState(0)

    const columns = [
        { field: "ID", headerName : "ID", flex: 1, headerAlign: 'center', align: 'center', hide : 'true' },
        { field: 'username', headerName: '股票代號', flex: 1, headerAlign: 'center', align: 'center' },
        { field: 'date', headerName: '股票名稱', flex: 1, headerAlign: 'center', align: 'center' },
        { field: 'filename', headerName: '檔案下載', flex: 1, headerAlign: 'center', sortable: false, align: 'center', renderCell : rowData => <a href = { "http://140.116.214.154:3000/api/data/download/meetingData?filename=" + rowData.value } download = { rowData.value }>Download</a>  },
    ];

    useEffect(() => {
        axios.get("http://140.116.214.154:3000/api/data/superUser")
        .then((res) => {
            setSuperUser(res.data[0].superUser)
        }).catch((res) => {

        })
    }, [])

    return (
        <>
            { superUser === 1 ? <MeetingDataUploadComp /> : <></> }

        </>
    );
}

export default MeetingDataComp;
